contract Fishking is ERC20 {
	using SafeMath for uint;

	IUniswapV2Router02 public  uniswapV2Router;
	address public  uniswapV2Pair;

	bool private swapping;
	address public constant jfToken = 0x5fAc926Bf1e638944BB16fb5B787B5bA4BC85b0A; //JF
	uint public swapTokensAtAmount = 1 *  1e18;
	mapping(address => bool) public _isBlacklisted;
	uint public marketingFee = 10;
	address public _marketingWallet = 0xBEea22240fDDc880018d35EadDDEe147f0472515;
	mapping (address => bool) private _isExcludedFromFees;
	mapping (address => bool) public automatedMarketMakerPairs;

	event UpdateUniswapV2Router(address indexed newAddress, address indexed oldAddress);
	event ExcludeFromFees(address indexed account, bool isExcluded);
	event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);
	event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);
    

	constructor() ERC20("Fishking", "FISH", 18) {
		IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x069A306A638ac9d3a68a6BD8BE898774C073DCb3);
		address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), _uniswapV2Router.WETH());
		
		uniswapV2Router = _uniswapV2Router;
		uniswapV2Pair = _uniswapV2Pair;
		
		_setAutomatedMarketMakerPair(_uniswapV2Pair, true);
        
		excludeFromFees(owner(), true);
		excludeFromFees(_marketingWallet, true);
		excludeFromFees(address(this), true);

		_mint(owner(), 1e6 * (10**18));
	}

	receive() external payable {}

	function updateUniswapV2Router(address newAddress) public onlyOwner {
		require(newAddress != address(uniswapV2Router), "FISH: The router already has that address");
		emit UpdateUniswapV2Router(newAddress, address(uniswapV2Router));
		uniswapV2Router = IUniswapV2Router02(newAddress);
		address _uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(address(this), uniswapV2Router.WETH());
		uniswapV2Pair = _uniswapV2Pair;
	}

	function excludeFromFees(address account, bool excluded) public onlyOwner {
		require(_isExcludedFromFees[account] != excluded, "FISH: Account is already the value of 'excluded'");
		_isExcludedFromFees[account] = excluded;

		emit ExcludeFromFees(account, excluded);
	}

	function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) public onlyOwner {
		for(uint i = 0; i < accounts.length; i++) {
			_isExcludedFromFees[accounts[i]] = excluded;
		}

		emit ExcludeMultipleAccountsFromFees(accounts, excluded);
	}

	function setMarketingWallet(address payable wallet) external onlyOwner{
		_marketingWallet = wallet;
	}

	function setMarketingFee(uint value) external onlyOwner{
		marketingFee = value;
	}

	function setAutomatedMarketMakerPair(address pair, bool value) public onlyOwner {
		require(pair != uniswapV2Pair, "FISH: The pair cannot be removed from automatedMarketMakerPairs");

		_setAutomatedMarketMakerPair(pair, value);
	}
	
	function blacklistAddress(address account, bool value) external onlyOwner{
		_isBlacklisted[account] = value;
	}

	function _setAutomatedMarketMakerPair(address pair, bool value) private {
		require(automatedMarketMakerPairs[pair] != value, "FISH: Automated market maker pair is already set to that value");
		automatedMarketMakerPairs[pair] = value;
		emit SetAutomatedMarketMakerPair(pair, value);
	}

	function isExcludedFromFees(address account) public view returns(bool) {
		return _isExcludedFromFees[account];
	}

	function _transfer(address from, address to, uint amount) internal override {
		require(from != address(0), "ERC20: transfer from the zero address");
		require(to != address(0), "ERC20: transfer to the zero address");
		require(!_isBlacklisted[from] && !_isBlacklisted[to], 'Blacklisted address');

		if(amount == 0) {
			super._transfer(from, to, 0);
			return;
		}

		uint contractTokenBalance = balanceOf(address(this));

		bool canSwap = contractTokenBalance >= swapTokensAtAmount;

		bool isLP = automatedMarketMakerPairs[from]; // || automatedMarketMakerPairs[to];

		if( canSwap && 
			!swapping && 
			!isLP && 
			from != owner() &&
			to != owner()
		) {
			swapping = true;
			swapTokensForJF(contractTokenBalance);
			swapping = false;
		}


		bool takeFee = !swapping && !isLP;

		// if any account belongs to _isExcludedFromFee account then remove the fee
		if(_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
			takeFee = false;
		}

		if(takeFee) {
			/* uint fees = amount.mul(totalFees).div(100);
			if(automatedMarketMakerPairs[to]){
				fees += amount.mul(1).div(100);
			}
			
			amount = amount.sub(fees); */
			uint fee = amount * marketingFee / 100;
			amount = amount.sub(fee);
			super._transfer(from, address(this), fee);
		}

		super._transfer(from, to, amount);
	}

	function swapTokensForJF(uint tokenAmount) private {
		address[] memory path = new address[](3);
		path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
		path[2] = jfToken;
        
		_approve(address(this), address(uniswapV2Router), tokenAmount);

		uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
			tokenAmount,
			0,
			path,
			_marketingWallet,
			block.timestamp
		);
	}
    
    function rescueToken(address token, uint256 amount) public onlyOwner returns (bool success) {
        return IERC20(token).transfer(msg.sender, amount);
    }
}

